import './Deck.css';
import PropTypes from 'prop-types';

const Deck = ({ message }) => {
  return (
    <div className="deck">
      {message}
    </div>
  );
};

Deck.propTypes = {
  message: PropTypes.string.isRequired, // Ensure message is a required string
  cards: PropTypes.arrayOf(PropTypes.number), // Validate cards array if needed
};

export default Deck;
